L’Agence de l’eau est un établissement public de l’Etat, sous la tutelle du ministère en charge de l’Environnement. Elle a pour missions de contribuer à améliorer la gestion de l’eau, de lutter contre sa pollution et de protéger les milieux aquatiques. 
Elle intervient dans trois grands domaines : 
•	la lutte contre la pollution ; 
•	la préservation et la gestion de la ressource en eau ;
•	le soutien à la connaissance et à la coopération des acteurs de l'eau.

L’OFII, établissement public administratif placé sous la tutelle du Ministère de l’Intérieur, a cinq missions principales:
➢ gestion des procédures régulières aux côtés ou pour le compte des préfectures et postes diplomatiques et consulaires;
➢ accueil et intégration des immigrés autorisés à séjourner durablement en France;
➢ accueil des demandeurs d’asile;
➢ aide au retour et à la réinsertion des étrangers dans leur pays d’origine;
➢ gestion de la procédure d’admission au séjour des étrang

Le CENTRE HOSPITALIER DE BOURBONNE-LES-BAINS est un établissement public départemental de santé qui œuvre dans les domaines suivants :
•	La prise en charge des personnes âgées dépendantes (EHPAD) ;
•	Les services de soins infirmiers à domicile (SSIAD) ;
•	Les soins médicaux et techniques importants (SMTI) ;
•	La médecine physique et de réadaptation (MPR) ;
•	Les activités et les soins adaptés (PASA) ;
•	L’accueil de jour (AJ) ;
•	La médecine générale.

- Assurer la viabilité du réseau ;
- Entretenir et améliorer le patrimoine lié aux routes ;
- Concevoir, réaliser et mettre en service de nouveaux projets d'investissement.

ATALIAN Propreté est composé de plus de 100 agences et antennes régionales et est spécialisée dans :
-	Le nettoyage de différents milieux avec une expertise multi-sectorielle et un savoir-faire spécifique ;
-	L’apport de solutions complémentaires aux entreprises clients  avec ses services associés ;

MTO-EUROGEM est spécialisée dans :

- Le Multi technique ;
- Le Multiservice ;

PINSON PAYSAGE a une expertise multisectorielle en aménagement, maintenance et rénovation dans :
 - Les espaces urbains et périurbains ;
 - Les espaces sportifs ;
 - Les espaces de loisirs ;
 - Les espaces naturels.

BIC SERVICES est une filiale du Groupe BIC d'environ 500 salariés, ayant pour objet, en France et à l'étranger:
- toutes activités de prestations de services ; informations et conseils se rapportant à ces activités ;
- et, généralement, toutes opérations financières, commerciales, industrielles, mobilières et immobilières, pouvant se rattacher directement ou indirectement à l’objet ci-dessus ou à tous objets similaires ou connexes, de nature à favoriser son extension ou son développement.

Les fabrications peuvent être regroupées en trois familles :
- jambons et épaules ;
- pâtes fines (saucisses et saucisses cocktails) et saucisson cuit;
- aides culinaires

